import Layout from '../components/Layout';
import axios from 'axios';

const Index = (props) => {
  console.log(props.data)
  return (
    <Layout>
      <div>
        Lorem ipsum
      </div>
    </Layout>
  )
}

export async function getStaticProps() {
  const { data } = await axios.get('http://localhost:3000/data.json')

  return {
    props: {
      data
    }
  }
}

export default Index;
